sys_variable_value.value:
(function execute(inputs, outputs) {
var slicer = "slic3r";//gs.getProperty('x_258747_octoprint.default_slicer');
  var location = "sdcard";
  var gcFile = inputs.fileName.replace(".stl",".gco");
  var stFile = inputs.fileName;
  if(inputs.task){
    //make the file in OctoPrint unique to the print job to sync with SN
      gcFile = inputs.task.number + "_" + gcFile;
    stFile = inputs.task.number + "_" + inputs.fileName;
  }

  outputs.slicer = slicer;
  outputs.location = location;
  outputs.gcode_file = gcFile;
  outputs.stl_file = stFile;

})(inputs, outputs);

